import React from 'react';

const VolunteerList = ({ volunteers }) => {
    return (
        <ul>
            {volunteers.map((volunteer, index) => (
                <li key={index}>{volunteer.name}</li>
            ))}
        </ul>
    );
};

export default VolunteerList;
